import React from "react";
import { useFormik } from "formik";
import styled from "styled-components";

const SignupForm = () => {
  const formik = useFormik({
    initialValues,
    validate,
    onSubmit,
  });

  return (
    <div>
      <form onSubmit={formik.handleSubmit}>
        <label>name</label>
        <input
          type="text"
          id="name"
          name="name"
          onChange={formik.handleChange}
          value={formik.values.name}
        ></input>
        <ValidateAlert>{formik.errors.name}</ValidateAlert>

        <label>E-mail</label>
        <input
          type="text"
          id="email"
          name="email"
          onChange={formik.handleChange}
          value={formik.values.email}
        ></input>
        <ValidateAlert>{formik.errors.email}</ValidateAlert>

        <label>channel</label>
        <input
          type="text"
          id="channel"
          name="channel"
          onChange={formik.handleChange}
          value={formik.values.channel}
        ></input>
        <ValidateAlert>{formik.errors.channel}</ValidateAlert>

        <button type="submit">확인</button>
      </form>
    </div>
  );
};
export default ValidateAlert;
